    false,nt"url": null,nt"notes": "The purpose the authoru2019s work and trip
    to this island was to conduct homing experiments with Arctic Terns, to determine
    if this is a suitable species for experimental investigations for the sensory basis
    of navigation. This report includes (1) a summary of the homing experiments, (2)
    some remarks on aspects of tern biology, (3) observations on predation and parasitism
    by gulls, (4) plans for future work, and (5) short notes on birds seen on and from
